import React from "react";
import { Card, Button, Form } from 'react-bootstrap';
import './css.css';
function renderUsers() {
  let lssst = this.state.list;
  const userList = [];
  for (let i = 0; i < lssst.length; i++) {

    userList.push(<h1>number is : {i}</h1>);
  }

  return userList;
}
export default function ListVote(props) {
  let changeMode = props.action;
  React.useEffect(() => {
    this.setState({ list: [1, 2, 3] })
  });
  

  return (
    <div className="warp-content">
      {this.renderUsers()}
    </div>
  );
}
